private String getLzoCodecClass() {
  String extClazzConf = conf.get(CONF_LZO_CLASS);
  String extClazz = (extClazzConf != null) ?
      extClazzConf : System.getProperty(CONF_LZO_CLASS);
  return (extClazz != null) ? extClazz : defaultClazz;
